        "name": "filter",
        "type": "filter",
        "label": "Filter",
        "options": {
            "logic": "and",
            "store": [
                {
                    "value": "updated_at",
                    "label": "[Date] Updated"
                }
            ],
            "operators": [
                {
                    "label": "Date",
                    "options": [
                        {
