function parseFilter(params) {
    if (!params.filter) return params 

    params.filter[0].forEach(filter => {
        try {
            const date = iml.formatDate(filter.b, "YYYY-MM-DDTHH:mm:ss.SSS")

            const condition = filter.o.replace("date::", "")

            params = {
                ...params,
                [`${filter.a}[${condition}]`]: date
            }
        } catch (error) {
            throw new Error(`"${filter.b}" is not a valid date.`)
        }
    });

    params = {
        ...params,
        filter: undefined
    }

    return params
}

