function getStepTypes(steps) {
    if (!steps) return

    debug(steps, typeof steps)
    function enhanceLabel(name) {
        const spltName = name.split(" ");
        return spltName
            .map((word) => [word[0].toUpperCase(), word.slice(1)].join(''))
            .join(" ");
    }
    const types = steps.reduce((acc, step) => {
        if (acc.indexOf(step.type) === -1) {
            acc = [...acc, step.type];
            return acc;
        }

        return acc;
    }, []);

    return types.map((type) => ({
        label: enhanceLabel(type),
        value: type,
    }));
}

