function getCadencesWithSteps(steps, cadences) {
    if (!steps) return cadences;

    let stepCadencesIds = [];

    if (Array.isArray(steps)) {
        stepCadencesIds = steps.reduce((acc, step) => {
            if (step.cadence && step.cadence.id) {
                if (acc.includes(step.cadence.id)) return acc;

                return [...acc, step.cadence.id];
            }

            return acc;
        }, []);
    }

    const filteresCadences = cadences.filter((cadence) =>
        stepCadencesIds.includes(cadence.id)
    );

    return filteresCadences;
}
